Крім інших статей, дивіться наступні:

## Цивільна адміністрація

> – Адміністративна автономія, Вищі органи влади, Колоніальні капітанства, Пожертвування, Донатарії, Губернатори, Генеральні збори, Орден Христа, Адміністративна організація, Заселення, Колонізація, Представництво в кортесах та Сесмарія;

## Церковна адміністрація 

> – Архієпископство, Єпископи та ім'я кожного священика, Капітул, Колегіальні церкви, Конституції єпископа, Монастирі, Єпархія, Парафії, Єзуїти, Новий монастир, Орден Христа та Серафімський орден; 

## Податкова адміністрація

> – Митниці, Податки, Рада скарбниці, Податкова організація та Доходи і витрати; 

## Судова адміністрація

> – Судова адміністрація, Юрисдикції, Земельні реєстри, Донатарії, Судді, Судова організація та Поліція; 

## Військова адміністрація 

> – Стрілецький майданчик, Військові командири, Донатарії, Укріплення, Військовий гарнізон, Військова організація, Поліція, Окупації, Невідомий солдат та Несподіванка; 

## Муніципальна адміністрація

> – Літопис муніципалітету, Муніципальні ради, Капітанства, Ради, Статути, Муніципалітети та Адміністративна організація; 

## Парафіяльна адміністрація 

> – Парафії, Парафіяльні ради та Адміністративна організація.
